import React from 'react';
import { Grid } from '@material-ui/core';
import Images from '/src/components/Products/Product/Images/Bow-Angel-Wreath'
import Product from './Product/Product'

const products = [
    { id: 1, name: 'Half-A-Moon', description: 'Half decorated wreath.', price: '$50', image: URL('../Products/Product/Images/Half-a-Moon-Wreath.jpg') },
    // { id: 2, name: 'Bow Angel', description: 'Big bow decrotaed wreath.', price: '$75', image: '../Products/Product/Images/Bow-Angel-Wreath.jpg'},
    // { id: 3, name: 'The N Wreath', description: 'The letter N decorated Wreath.', price: '$100', image: ''},
];

const Products = () => {
    return (
        <main>
            <Grid container justify="center" spacing={4}>
                {products.map((product) => (
                    <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}>
                        <Product product={product} />
                    </Grid>
                ))}
            </Grid>
        </main>
    );
}

export default Products;
